

  CREATE TABLE "ASSIGNMENT" 
   (	"배정일" DATE, 
	"알바생번호" VARCHAR2(8 BYTE), 
	"지점코드" VARCHAR2(8 BYTE), 
	"호실번호" NUMBER(38,0)
   );


  CREATE TABLE "BRANCH" 
   (	"지점코드" VARCHAR2(8 BYTE), 
	"지점명" VARCHAR2(15 BYTE), 
	"주소" VARCHAR2(50 BYTE), 
	"전화번호" VARCHAR2(13 BYTE), 
	"관리자번호" NUMBER(5,0)
   );


  CREATE TABLE "MANAGER"
   (	"관리자번호" NUMBER(5,0), 
	"이름" VARCHAR2(12 BYTE), 
	"전화번호" VARCHAR2(13 BYTE), 
	"주소" VARCHAR2(200 BYTE)
   );

  CREATE TABLE "PARTTIMER"
   (	"알바생번호" VARCHAR2(8 BYTE), 
	"이름" VARCHAR2(12 BYTE), 
	"전화번호" VARCHAR2(13 BYTE), 
	"주소" VARCHAR2(100 BYTE), 
	"계좌번호" VARCHAR2(20 BYTE), 
	"멘토알바생번호" VARCHAR2(8 BYTE)
   );

  CREATE TABLE "ROOM" 
   (	"지점코드" VARCHAR2(8 BYTE), 
	"호실번호" NUMBER(38,0), 
	"전화번호" VARCHAR2(10 BYTE)
   );

  CREATE TABLE "SALARY" 
   (	"급여일자" DATE, 
	"금액" NUMBER(38,0) DEFAULT 0, 
	"알바생번호" VARCHAR2(13 BYTE), 
	"지급여부" VARCHAR2(1 BYTE)
   );

  CREATE TABLE "WORKRECORD"
   (	"근무날짜" DATE, 
	"출근시간" TIMESTAMP (6), 
	"퇴근시간" TIMESTAMP (6), 
	"총근무시간" FLOAT(126), 
	"알바생번호" VARCHAR2(8 BYTE)
   );

